<!-- START content: pl,sport-glowna -->
<p><strong>Witamy w Bazantowo Sport</strong></p>

<p>Bazantowo Sport jest wyjatkowe, jak miejsce w kt&oacute;rym sie znajduje. Powstalo z mysla o ludziach w kazdym wieku, aktywnych i nowoczesnych.</p>

<p>Kazdego dnia goscimy setki klient&oacute;w, dla kt&oacute;rych zdrowie i aktywnosc sa naprawde wazne. Nasz Klient ma od 4 do 100 lat. Tak. Cieszymy sie ogromna frekwencja Dzieci i Senior&oacute;w. Nie bez przyczyny wlasnie dzieci stanowia ogromny nasz potencjal albowiem w ramach multifunkcyjnosci obiektu rodzic moze swobodnie realizowac swoje plany treningowe powierzajac pocieche w tym czasie jednej z naszych sekcji sportowych.</p>

<p>To absolutnie wyjatkowa synergia.</p>

<p>Bazantowo Sport to najwiekszy kompleks sportowy na Slasku. Na powierzchni ok. 10 tys. m kw. znajduja sie: <strong>hala tenisowa, korty do squasha, fitness klub, silownia, centrum rehabilitacji, spa, basen, 10 saun (w trakcie remontu), hala sportowa, scianka wspinaczkowa, boiska do badmintona i bowling. </strong>Oferte dopelnia <strong>trzygwiazdkowy hotel, restauracja </strong>oraz <strong>pub </strong>w stylu angielskim.</p>

<p>Nasze motto to: Sport i emocje!</p>

<!-- END content: pl,sport-glowna -->

